"(function() {
    console.log('[YOUTUBE DEBUG] Script started');

    function debugMessage(msg) {
        console.log('[YOUTUBE DEBUG] ' + msg);
        try {
            window.webkit.messageHandlers.iosListener.postMessage({
                type: 'debug',
                message: '[YOUTUBE] ' + msg,
                timestamp: Date.now()
            });
        } catch(e) {
            console.log('Could not send debug message to iOS:', e);
        }
    }

    function modifyYouTubeIframes() {
        var iframes = document.querySelectorAll('iframe'); 
        var youtubeCount = 0;

        iframes.forEach(function(iframe, index) {
            if (iframe.src.includes('youtube.com/embed') || iframe.src.includes('youtube-nocookie.com/embed')) {
                youtubeCount++;
                debugMessage('Found YouTube iframe #' + youtubeCount + ': ' + iframe.src);

                // Enable fullscreen instead of disabling it
                iframe.setAttribute('allowfullscreen', 'true');
                iframe.setAttribute('webkitallowfullscreen', 'true');
                iframe.setAttribute('mozallowfullscreen', 'true');

                debugMessage('Set allowfullscreen=true for iframe #' + youtubeCount);

                // Listen for fullscreen events on YouTube iframe
                try {
                    iframe.addEventListener('fullscreenchange', function() {
                        if (document.fullscreenElement === iframe) {
                            debugMessage('YouTube fullscreen ENTER detected');
                            window.webkit.messageHandlers.iosListener.postMessage({
                                type: 'youtubeFullscreenEnter',
                                iframe: iframe.src,
                                timestamp: Date.now()
                            });
                        } else {
                            debugMessage('YouTube fullscreen EXIT detected'); 
                            window.webkit.messageHandlers.iosListener.postMessage({
                                type: 'youtubeFullscreenExit',
                                iframe: iframe.src,
                                timestamp: Date.now()
                            });
                        }
                    });

                    iframe.addEventListener('webkitfullscreenchange', function() {
                        if (document.webkitFullscreenElement === iframe) {
                            debugMessage('YouTube webkit fullscreen ENTER detected');
                            window.webkit.messageHandlers.iosListener.postMessage({
                                type: 'youtubeFullscreenEnter',
                                iframe: iframe.src,
                                timestamp: Date.now()
                            });
                        } else {
                            debugMessage('YouTube webkit fullscreen EXIT detected');
                            window.webkit.messageHandlers.iosListener.postMessage({
                                type: 'youtubeFullscreenExit', 
                                iframe: iframe.src,
                                timestamp: Date.now()
                            });
                        }
                    });

                    debugMessage('Added fullscreen event listeners to iframe #' + youtubeCount);
                } catch(e) {
                    debugMessage('Could not add fullscreen listeners: ' + e.message);
                }
            }
        });

        if (youtubeCount > 0) {
            debugMessage('Total YouTube iframes processed: ' + youtubeCount);
        } else {
            debugMessage('No YouTube iframes found');
        }
    }

    // Run initially
    modifyYouTubeIframes();

    // Enhanced observer for YouTube changes
    var youtubeObserver = new MutationObserver(function(mutations) {
        var shouldCheck = false;
        mutations.forEach(function(mutation) {
            mutation.addedNodes.forEach(function(node) {
                if (node.tagName === 'IFRAME') {
                    shouldCheck = true;
                }
            });
        });

        if (shouldCheck) {
            debugMessage('New iframe detected, re-checking YouTube videos');
            setTimeout(modifyYouTubeIframes, 100);
        }
    });

    youtubeObserver.observe(document.body, {
        childList: true,
        subtree: true,
        attributes: true
    });

    // Additional periodic check specifically for YouTube embeds
    setInterval(function() {
        modifyYouTubeIframes();
    }, 3000);

    debugMessage('YouTube script setup complete');
})();"

"(function() {
    console.log('[VIMEO DEBUG] Script started');

    function debugMessage(msg) {
        console.log('[VIMEO DEBUG] ' + msg);
        try {
            window.webkit.messageHandlers.iosListener.postMessage({
                type: 'debug',
                message: '[VIMEO] ' + msg,
                timestamp: Date.now()
            });
        } catch(e) {
            console.log('Could not send debug message to iOS:', e);
        }
    }

    function modifyVimeoIframes() {
        var iframes = document.querySelectorAll('iframe');
        debugMessage('Found ' + iframes.length + ' total iframes');

        var vimeoCount = 0;
        iframes.forEach(function(iframe) {
            if (iframe.src.includes('vimeo.com/video') || iframe.src.includes('player.vimeo.com')) {
                vimeoCount++;
                debugMessage('Found Vimeo iframe #' + vimeoCount + ': ' + iframe.src);

                var src = iframe.src;
                iframe.setAttribute('allowfullscreen', 'true');
                iframe.setAttribute('webkitallowfullscreen', 'true');
                debugMessage('Set allowfullscreen=true for iframe #' + vimeoCount);

                // Listen for Vimeo fullscreen events
                try {
                    iframe.contentWindow.postMessage(JSON.stringify({
                        method: 'addEventListener',
                        value: 'enterfullscreen'
                    }), '*');

                    iframe.contentWindow.postMessage(JSON.stringify({
                        method: 'addEventListener', 
                        value: 'exitfullscreen'
                    }), '*');
                    debugMessage('Added event listeners to iframe #' + vimeoCount);
                } catch(e) {
                    debugMessage('Could not add event listeners to iframe #' + vimeoCount + ': ' + e.message);
                }
            }
        });

        if (vimeoCount === 0) {
            debugMessage('No Vimeo iframes found');
        } else {
            debugMessage('Modified ' + vimeoCount + ' Vimeo iframes');
        }
    }

    // Listen for ALL window messages to debug
    window.addEventListener('message', function(event) {
        debugMessage('Received message from origin: ' + event.origin);
        debugMessage('Message data: ' + JSON.stringify(event.data));

        if (event.origin === 'https://player.vimeo.com') {
            debugMessage('This is a Vimeo player message');

            try {
                var data = JSON.parse(event.data);
                debugMessage('Parsed Vimeo data: ' + JSON.stringify(data));

                if (data.event === 'enterfullscreen') {
                    debugMessage('DETECTED: Vimeo video entered fullscreen!');
                    window.webkit.messageHandlers.iosListener.postMessage({
                        type: 'vimeoFullscreenEnter',
                        timestamp: Date.now()
                    });
                } else if (data.event === 'exitfullscreen') {
                    debugMessage('DETECTED: Vimeo video exited fullscreen!');
                    window.webkit.messageHandlers.iosListener.postMessage({
                        type: 'vimeoFullscreenExit',
                        timestamp: Date.now()
                    });
                }
            } catch(e) {
                debugMessage('Error parsing Vimeo message: ' + e.message);
            }
        }
    });

    // Monitor fullscreen API changes
    document.addEventListener('fullscreenchange', function() {
        debugMessage('Fullscreen change detected - isFullscreen: ' + !!document.fullscreenElement);
    });

    document.addEventListener('webkitfullscreenchange', function() {
        debugMessage('Webkit fullscreen change detected - isFullscreen: ' + !!document.webkitFullscreenElement);
    });

    // Run initially
    debugMessage('Running initial iframe modification');
    modifyVimeoIframes();

    // Observer for Vimeo iframe changes
    var vimeoObserver = new MutationObserver(function(mutations) {
        var hasNewIframes = false;
        mutations.forEach(function(mutation) {
            mutation.addedNodes.forEach(function(node) {
                if (node.tagName === 'IFRAME') {
                    hasNewIframes = true;
                }
            });
        });

        if (hasNewIframes) {
            debugMessage('New iframes detected, re-running modification');
            modifyVimeoIframes();
        }
    });

    vimeoObserver.observe(document.body, {
        childList: true,
        subtree: true,
        attributes: true,
        characterData: true
    });

    debugMessage('Vimeo script setup complete');

    // Add manual debug trigger - can be called from browser console
    window.debugWindowMonitor = function() {
        debugMessage('Manual window monitor trigger requested');
        window.webkit.messageHandlers.iosListener.postMessage({
            type: 'debugWindowMonitor',
            timestamp: Date.now()
        });
    };

    debugMessage('Added window.debugWindowMonitor() function for manual debugging');
})();"

